  \"High Temperature Structures With Inherent Protection Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:56:53.404456\",\n\t\"name\": \"high-temperature-structures-with-inherent-protection-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The hot structures for current space vehicles
  require an atmospheric entry thermal protection system.  Reusable hot structures
  that can function without requiring any atmospheric entry thermal protection system
  for space vehicle would constitute a paradigm.  A high temperature stable fiber
  reinforcement and a ceramic material that exhibits atmospheric entry thermal stability
  can be combined into a composite which possess the mechanical properties to serve
  as a reusable hot structure that can function without any atmospheric entry thermal
  protection system.  This unique and new ceramic matrix composite (CMC) will be developed
  and characterized to demonstrate it can meet the requirements of a reusable hot
  structure for space vehicles which can operate without any atmospheric entry thermal
  protection system and optimized samples will be delivered for more detailed testing
  at NASArnrn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
